import React from 'react'
import classes from './css/categoriesList.module.css'

const CategoryItem = ({category}) => {
  return (
    <div>
        {console.log(category)}
        <h3>{category.title}</h3>
        <h3>{category.description}</h3>
    </div>
  )
}

export default CategoryItem
